// 默认数据
const defaultState = {
  inputValue : 'Write Something',
  list:[
      '早上4点起床，锻炼身体',
      '中午下班游泳一小时'
  ]
} 
// state: 是整个项目中需要管理的数据信息，这里我们没有什么数据，所以用空对象来表示
export default (state = defaultState, action) => {  //就是一个方法函数
    return state;
}
